import React from 'react'

export default function ChatList({msg}) {
    return (
        <section className="chat-list">
            {msgs.length > 0 && <ul className="clean-list">
                {msgs.map(msg => {
                    return (
                        <li className="chat-item">
                            <p>{msg.txt}</p>
                        </li>
                    )
                })}
            </ul>}
            {!msgs.length && <h1>No Msgs</h1>}
        </section>
    )
}
